function NavItem(props){
    return(
        <div className='NavItem-wrapper'>
            <div className="Icon-wrapper">
                <i className="active">{props.iconA}</i>
                <i>{props.iconB}</i>
            </div>
            <label>{props.title}</label>
        </div>
    );
}
export default NavItem
